    function buscarRelatorio() {
      let cpf = document.getElementById('cpfInput').value.trim();
      cpf = cpf.replace(/\D/g, '');
      cpf = cpf.padStart(11, '0');

      const resultado = document.getElementById('resultado');

      if (cpfInfo[cpf]) {
        const info = cpfInfo[cpf];
        resultado.innerHTML = `
          <p>Colocação: <strong>${info.colocacao}º lugar</strong></p>
          <p><a href="${info.link}" target="_blank">Clique aqui para acessar seu relatório</a></p>
        `;
      } else {
        resultado.textContent = 'CPF não encontrado. Verifique se digitou corretamente.';
      }
    }
  </script>
